reviewContent:
패브릭은 첨인데 뭔가 보석들이 균일하게 안붙는 단점이 있네요ㅠ
액자추가 구매  해야지만
완성작도 예쁠듯;;;

저번 해바라기 이후로 또 주문해서 하고있어요ㅎㅎ
부모님 선물해드렸더니 좋아하셨답니당
새로 주문한 돌고래도 그림이 너무 예뻐요ㅜㅜ 열심히 만들어보겠습니당&hearts;

반짝반짝 정말 이쁜데요..
이거 너무커서 정말 새벽까지 하다자고 시간이 꽤 오래걸렸어요 완성하고보니 액자가 맞는게 없네요
이거에 맞는액자 여긴왜 판매안하시죠?;;;

